import React from 'react'
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Badge } from "@material-ui/core";
import { Search, ShoppingCartOutlined } from "@material-ui/icons";
import classes from './Navbar.module.css'

const Navbarr = () => {

  return (
    <Navbar bg="light" expand="lg">
    <Container>
      <Navbar.Brand href="#"
      >E-SHOP</Navbar.Brand>
      <Navbar.Toggle aria-controls="navbarScroll" />
      <Navbar.Collapse id="navbarScroll">
       
        <div className={classes.navbarRight}>
        <input type='search' placeholder="Search" />
            <Search style={{ color: "gray", fontSize: 26 }} 
            className={classes.searchIcon}
            />
        </div>
        <Nav
        className={`my-2 my-lg-0 ${classes.navbar}`}
         navbarScroll >
          <Nav.Link style={{color:"#000"}} href="#action2">REGISTER</Nav.Link>
          <Nav.Link style={{color:"#000"}} href="#action2">SIGN IN</Nav.Link>
          <Nav.Link style={{color:"#000"}} href="#action2">
          <Badge badgeContent={4} color="primary">
              <ShoppingCartOutlined />
            </Badge>
         

          </Nav.Link>
          
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
  )
}

export default Navbarr
